import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Questions({getId}, props) {

    const q = getId(props.id);
    console.log(q);

    return(
        <Paper>
            <h1>Detail's page</h1>
            <p>{q.title}</p> 
        </Paper>
    )
}
